// Call this function first thing in a script tag in the body
function showLoadingImage() {
  // Write a hardcoded moving gif as loading icon
  document.write(`<img id="loadingicon" style="display:block;margin:100px auto 0 auto;" src="data:image/gif;base64,">`);

  // Remove the loading icon as soon as possible after everything is loaded
  setTimeout(function() {
    var img = document.getElementById('loadingicon');
    img.parentNode.removeChild(img);
  }, 1000);        
}
